void Sound_Init(void){
	DAC_Init();
  NVIC_ST_CTRL_R = 0;								// disable SysTick
	NVIC_ST_RELOAD_R = 7273;		      // reload
  NVIC_ST_CURRENT_R = 0;						// clear current time	
	NVIC_ST_CTRL_R = 0x2;							// enable interrupt	
}


void SysTick_Handler(void){ 
	DAC_Out(*(sound+soundindex));
	soundindex++;
	if(soundindex == num){
		NVIC_ST_CTRL_R = 2;								// disable SysTick
	}
}


